/* @jsx mdx */
  import React from 'react'
  import { mdx } from '@mdx-js/react'
  /* @jsx mdx */


const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">
    <h1 {...{
      "id": "unix-command-line"
    }}>{`Unix Command Line`}</h1>
    <h2 {...{
      "id": "resources"
    }}>{`Resources`}</h2>
    <ol>
      <li parentName="ol"><a parentName="li" {...{
          "href": "https://unix.stackexchange.com/questions/39501/difference-between-ifconfig-and-ipconfig/39502"
        }}>{`ipconfig vs ifconfig`}</a></li>
    </ol>
    <h2 {...{
      "id": "useful-programs"
    }}>{`Useful programs`}</h2>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Program`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Use`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`head`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`See first n lines of file`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`tail`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`See last n lines of file`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`sort`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Sort the output`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`less`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`A filter for paging through text one screenful at a time`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`su`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Switch user`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`shred`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Securely remove file by overwriting and removing`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`which`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Shows the path of the command`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`ps`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Process`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`rsync`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`scp but better for SSH access moving files`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`scp`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Secure Copy Protocol`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`source`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Source shell vars`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`ln`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Link folders`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`top`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Show process, memory etc`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`time`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`How long a process takes to run`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`cut`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`cut columns from a file`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`awk`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Programming language built for text processing (Aho, Weinberger, Kernighan (authors))`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`sed`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Same as awk (Stream editor)`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`uniq`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Filter unique`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`column`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Remedy ugly output by spacing with columns`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`find`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Find file (like want -name or -iname flag)`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`diff,comm`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Diff or find commonality between two files`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`tr`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Translate - also useful with "-d" flag to delete`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`split`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Split a file up`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`nl`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Numbered line`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`yes`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Prints character "y"`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`crontab`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Used to run cron jobs`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`apropos`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Display related commands to arg. French "à propos" which means appropriate.`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`watch`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Use to monitor`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`dig`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`DNS lookup utility`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`ifconfig`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Network information`}</td>
        </tr>
      </tbody>
    </table>
    <h2 {...{
      "id": "downloaded-useful-programs"
    }}>{`Downloaded, Useful Programs`}</h2>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Program`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Use`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`rg`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Fast grep search`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`bat`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`A modern cat`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`codemod`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Multi-file search and replace`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`tree`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Show file tree`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`tmux`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Sessions, windows and panes`}</td>
        </tr>
      </tbody>
    </table>
    </MDXLayout>;
}

MDXContent.isMDXComponent = true;
